import React from 'react' 
import {Form,Col,label,input} from 'react-bootstrap'
import './LogIn.css';
class LogIn extends React.Component {

    render(){
        
        return(
            <div className="login-wrapper">
      <h1>Please Log In</h1>
      <form>
        <label>
          <p>Username</p>
          <input type="text" />
        </label>
        <label>
          <p>Password</p>
          <input type="password" />
        </label>
        <div>
          <button type="submit">Submit</button>
        </div>
      </form>
    </div>
        )
    }

}

export default LogIn;
